import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';

const HeaderNavigation = ({ brandName = "CHECKERS", logoUrl, navLinks = [] }) => {
  return (
    <Navbar expand="lg" className="justify-content-center px-5">
      <Navbar.Brand href="#">
        {logoUrl && (
          <img
            src={logoUrl}
            alt={`${brandName} Logo`}
            width="30"
            height="30"
            className="d-inline-block align-top"
          />
        )}
        <span className="ml-2">{brandName}</span>
      </Navbar.Brand>
      <Nav className="ml-auto">
        {navLinks.map((link, index) => (
          <Nav.Link key={index} href={link.href}>
            {link.label}
          </Nav.Link>
        ))}
      </Nav>
    </Navbar>
  );
};

export default HeaderNavigation;
